class TeamMemberList extends Component {
  state = {};
  render() {
    return (
      <div>
        <input type="text" placeholder="Enter name" />
        <br />
        <br />
        <button className="btn btn-info">Create Group!</button>
      </div>
    );
  }
}

export default TeamMemberList;
